import React from 'react';

export const PcardColored = () => {
  return (
    <div className="w-60 h-80 bg-gray-800 p-3 flex flex-col gap-1 rounded-br-3xl">
      <div className="duration-500 contrast-50 h-48 bg-gradient-to-bl from-black via-orange-900 to-indigo-600 hover:contrast-100"></div>
      <div className="flex flex-col gap-4">
        <div className="flex flex-row justify-between">
          <div className="flex flex-col">
            <span className="text-xl text-gray-50 font-bold">Long Chair</span>
            <p className="text-xs text-gray-400">ID: 23432252</p>
          </div>
          <span className="font-bold text-red-600">$300.99</span>
        </div>
        <button className="hover:bg-sky-700 text-gray-50 bg-sky-800 py-2 rounded-br-xl">Add to cart</button>
      </div>
    </div>
  );
}

export default PcardColored;
